import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.util.StringTokenizer;

public class Main {
    static class Pair {
        int x, y;

        public Pair(int x, int y) {
            this.x = x;
            this.y = y;
        }
    }

    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        StringTokenizer st = new StringTokenizer(br.readLine());
        int W = Integer.parseInt(st.nextToken());
        int H = Integer.parseInt(st.nextToken());
        int N = Integer.parseInt(st.nextToken());

        Pair[] cable = new Pair[2];
        st = new StringTokenizer(br.readLine());
        cable[0] = new Pair(Integer.parseInt(st.nextToken()), Integer.parseInt(st.nextToken()));
        cable[1] = new Pair(Integer.parseInt(st.nextToken()), Integer.parseInt(st.nextToken()));

        int[][][] dp = new int[H][W][4];
        for (int i = 0; i < H; i++) {
            for (int j = 0; j < W; j++) {
                for (int k = 0; k < 4; k++) {
                    dp[i][j][k] = Integer.MAX_VALUE;
                }
            }
        }

        for (int i = 0; i < N; i++) {
            st = new StringTokenizer(br.readLine());
            int x = Integer.parseInt(st.nextToken());
            int y = Integer.parseInt(st.nextToken());
            String s = st.nextToken();
            int T = Integer.parseInt(st.nextToken());

            for (int j = 0; j < 4; j++) {
                int dx = 0, dy = 0;
                switch (j) {
                    case 0:
                        dx = 0;
                        dy = -1;
                        break;
                    case 1:
                        dx = 0;
                        dy = 1;
                        break;
                    case 2:
                        dx = -1;
                        dy = 0;
                        break;
                    case 3:
                        dx = 1;
                        dy = 0;
                        break;
                }

                for (int k = 0; k < T; k++) {
                    int nx = x + dx * (s.length() - 1 - k) % (s.length() - 1 - k);
                    int ny = y + dy * (s.length() - 1 - k) % (s.length() - 1 - k);

                    if (nx < 0 || nx >= W || ny < 0 || ny >= H) {
                        nx = x;
                        ny = y;
                    }

                    dp[ny][nx][j] = Math.min(dp[ny][nx][j], dp[y][x][j] + (k > 0 ? 1 : 0));
                }
            }
        }

        int ans = Integer.MAX_VALUE;
        for (int i = 0; i < H; i++) {
            for (int j = 0; j < W; j++) {
                for (int k = 0; k < 4; k++) {
                    if (cable[0].x <= j && j < cable[1].x && cable[0].y <= i && i < cable[1].y) {
                        ans = Math.min(ans, dp[i][j][k]);
                    }
                }
            }
        }

        System.out.println(ans);
    }
}
